3950271%2C23951138%2C23951621%2C23953834%2C23955099%2C23956287%2C23956877\\u0026ns=yt\\u0026plid=AAWxGKJmKErpoA82\\u0026referrer=https%3A%2F%2Fdistance3.sg.digipen.edu%2F\\u0026sdetail=p%3Adistance3.sg.digipen.edu%2F\\u0026sourceid=r\"},\"setAwesomeUrl\":{\"baseUrl\":\"https:\/\/www.youtube.com\/set_awesome?ei=pQR-X5_IHNKQ1AbSz7DoAg\\u0026plid=AAWxGKJmKErpoA82\\u0026video_id=t86v3N4OshQ\",\"elapsedMediaTimeSeconds\":120},\"atrUrl\":{\"baseUrl\":\"https:\/\/s.youtube.com\/api\/stats\/atr?docid=t86v3N4OshQ\\u0026ei=pQR-X5_IHNKQ1AbSz7DoAg\\u0026len=4332\\u0026ns=yt\\u0026plid=AAWxGKJmKErpoA82\\u0026ver=2\",\"elapsedMediaTimeSeconds\":5},\"youtubeRemarketingUrl\":{\"baseUrl\":\"https:\/\/www.youtube.com\/pagead\/viewthroughconversion\/962985656\/?backend=innertube\\u0026cname=1\\u0026cver=2_20201004\\u0026foc_id=iRBjSlxIlt5URzgHSGhHQA\\u0026label=followon_view\\u0026ptype=no_rmkt\\u0026random=528369598\",\"elapsedMediaTimeSeconds\":0}},\"videoDetails\":{\"videoId\":\"t86v3N4OshQ\",\"title\":\"The S.O.L.I.D. Principles of OO \\u0026 Agile Design - Uncle Bob Martin\",\"lengthSeconds\":\"4331\",\"keywords\":[\"uncle bob\",\"solid principles\",\"robert martin\",\"single responsibility principle\",\"dependency inversion principle\",\"clean code\",\"software craftsmanship\",\"clean architecture\",\"liskov substitution principle\",\"interface segregation principle\",\"solid design\",\"software development\",\"software architecture\",\"javascript\",\"software\",\"programming\",\"computer science\",\"agile\",\"developer\",\"developers\",\"solid\",\"coding\",\"S.O.L.I.D. Principles of OO Agile Design Uncle Bob Martin\"],\"channelId\":\"UCiRBjSlxIlt5URzgHSGhHQA\",\"isOwnerViewing\":false,\"shortDescription\":\"READ FIRST:\\n\\nThis video is more valuable that just \\\"another SOLID talk\\\". \\n\\nThis talk is still very entertaining and informative so sit back, relax, and enjoy!  Sometimes it's good for us to learn and understand the past, so that we do not make the same mistakes that have been made over and over again in this profession.\\n\\nIf you want a more in-depth training on it, UB has that on his CleanCoders.com site.  Very good vids there...very in depth on coding techniques and he codes a lot there.\\n\\nhttps:\/\/www.CleanCoders.com - ton of vids by UB, very in depth technically\\nhttp:\/\/www.WeDoTDD.com\/interviews\/companies\/16\\nhttps:\/\/twitter.com\/unclebobmartin\\nhttp:\/\/blog.cleancoder.com\\nhttps:\/\/blog.8thlight.com\/uncle-bob\/archive.html\\n\\nSource:\\nThis presentation was given by Uncle Bob on Feb 4, 2015 at the Arlington Lakes Golf Club in Arlington Heights, IL.\\n\\nSchaumburg Microsoft .NET Technologies Meetup http:\/\/bit.ly\/1hAO2ln\\nBe sure to change the video to 1080p when watching it\\nRecorded with my IPhone 6+ 1080p (60fps)\\n\\nSide Note:\\n\\nUB talks little about SR and DI toward the end, but it's more a talk around business and more top level tech talk around around decoupling code and history of coding (where the idea of decoupling stemmed from, how objects came into existence and why, and how programming languages were affected by it ended up providing polymorphism... and a lot of other interesting things around the importance of plug-in software....all indirectly related to the topic of SOLID itself as a whole.\\n\\nThe S.O.L.I.D. Principles of OO and Agile Design\\n\\nWhat happens to software? Why does is rot over time? How does an Agile Development team prevent this rot, and prevent good designs from becoming legacy code? How can we be sure our designs are good in the first place? This talk presents the agile S.O.L.I.D. principles for designing object oriented class structures. These principles govern the structure and inter dependencies between classes in large object oriented systems. \\n\\nThe principles include: The Open Closed Principle, The Liskov Substitution Principle, and the Dependency Inversion Principle, among others.\\n\\nAbout \\\"Uncle Bob\\\" Martin:\\n\\nRobert C. Martin h (60fps)\\n\\nSide Note:\\n\\nUB talks little about SR and DI toward the end, but it's more a talk around business and more top level tech talk around around decoupling code and history of coding (where the idea of decoupling stemmed from, how objects came into existence and why, and how programming languages were affected by it ended up providing polymorphism... and a lot of other interesting things around the importance of plug-in software....all indirectly related to the topic of SOLID itself as a whole.\\n\\nThe S.O.L.I.D. Principles of OO and Agile Design\\n\\nWhat happens to software? Why does is rot over time? How does an Agile Development team prevent this rot, and prevent good designs from becoming legacy code? How can we be sure our designs are good in the first place? This talk presents the agile S.O.L.I.D. principles for designing object oriented class structures. These principles govern the structure and inter dependencies between classes in large object oriented systems. \\n\\nThe principles include: The Open Closed Principle, The Liskov Substitution Principle, and the Dependency Inversion Principle, among others.\\n\\nAbout \\\"Uncle Bob\\\" Martin:\\n\\nRobert C. Martin has been a software professional since 1970. In the last 35 years, he has worked in various capacities on literally hundreds of software projects. He has authored \\\"landmark\\\" books on Agile Programming, Extreme Programming, UML, Object-Oriented Programming, and C++ Programming. He has published dozens of articles in various trade journals. Today, He is one of the software industry's leading authorities on Agile software development and is a regular speaker at international conferences and trade shows. He is a former editor of the C++ Report and currently writes a monthly Craftsman column for Software Development magazine. software craftsmanship\"},\"lengthSeconds\":\"4332\",\"ownerProfileUrl\":\"http:\/\/www.youtube.com\/user\/schinkelfamily\",\"externalChannelId\":\"UCiRBjSlxIlt5  Feb 4, 2015 at the Arlington Lakes Golf Club in Arlington Heights, IL.\n\nSchaumburg Microsoft .NET Technologies Meetup "},{"text":"http://bit.ly/1hAO2ln","navigationEndpoint":{"clickTrackingParams":"CNABEM2rARgBIhMIg6eXk4qj7AIVRgLVCh2UFg8USJTkuvDN-6vntwE=","commandMetadata":{"webCommandMetadata":{"url":"/redirect?q=http%3A%2F%2Fbit.ly%2F1hAO2ln\u0026redir_token=QUFFLUhqbHlCQ2NmUEh4WGxWcXJuZDk0VkpDRE5TMWpNUXxBQ3Jtc0tsVFhHcjIzTC1wOU9rZGpHMU9VS0FEcHJucFY0X0JPM0FnZHEtbnRzMlEyZkNqRnI1aVAxTXJvNHdhdFJsQTNXdlBWZ09qeXg1THNFeG16M0V5M1FNb2NEbElXa1RsOFR3WV9KX283RlNRaEVaejNSZw%3D%3D\u0026v=t86v3N4OshQ\u0026event=video_description","webPageType":"WEB_PAGE_TYPE_UNKNOWN","rootVe":83769}},"urlEndpoint":{"url":"/redirect?q=http%3A%2F%2Fbit.ly%2F1hAO2ln\u0026redir_token=QUFFLUhqbHlCQ2NmUEh4WGxWcXJuZDk0VkpDRE5TMWpNUXxBQ3Jtc0tsVFhHcjIzTC1wOU9rZGpHMU9VS0FEcHJucFY0X0JPM0FnZHEtbnRzMlEyZkNqRnI1aVAxTXJvNHdhdFJsQTNXdlBWZ09qeXg1THNFeG16M0V5M1FNb2NEbElXa1RsOFR3WV9KX283RlNRaEVaejNSZw%3D%3D\u0026v=t86v3N4OshQ\u0026event=video_description","target":"TARGET_NEW_WINDOW","nofollow":true}}},{"text":"\nBe sure to change the video to 1080p when watching it\nRecorded with my IPhone 6+ 1080p (60fps)\n\nSide Note:\n\nUB talks little about SR and DI toward the end, but it's more a talk around business and more top level tech talk around around decoupling code and history of coding (where the idea of decoupling stemmed from, how objects came into existence and why, and how programming languages were affected by it ended up providing polymorphism... and a lot of other interesting things around the importance of plug-in software....all indirectly related to the topic of SOLID itself as a whole.\n\nThe S.O.L.I.D. Principles of OO and Agile Design\n\nWhat happens to software? Why does is rot over time? How does an Agile Development team prevent this rot, and prevent good designs from becoming legacy code? How can we be sure our designs are good in the first place? This talk presents the agile S.O.L.I.D. principles for designing object oriented class structures. These principles govern the structure and inter dependencies between classes in large object oriented systems. \n\nThe principles include: The Open Closed Principle, The Liskov Substitution Principle, and the Dependency Inversion Principle, among others.\n\nAbout \"Uncle Bob\" Martin:\n\nRobert C. Martin has been a software professional since 1970. In the last 35 years, he has worked in various capacities on literally hundreds of software projects. He has authored \"landmark\" books on Agile Programming, Extreme Programming, UML, Object-Oriented Programming, and C++ Programming. He has published dozens of articles in various trade journals. Today, He is one of the software industry's leading authorities on Agile software development and is a regular speaker at international conferences and trade shows. He is a former editor of the C++ Report and currently writes a monthly Craftsman column for Software Development magazine. software craftsmanship"}]},"subscribeButton":{"subscribeButtonRenderer":{"buttonText":{"runs":[{"text":"Subscribe"}]},"subscriberCountText":{"simpleText":"1.36K"},"subscribed":false,"enabled":true,"type":"FREE","channelId":"UCiRBjSlxIlt5URzgHSGhHQA","showPreferences":false,"subscriberCountWithSubscribeText":{"simpleText":"1.36K"},"subscribedButtonText":{"runs":[{"text":"Subscribed"}]},"unsubscribedButtonText":{"runs":[{"text":"Subscribe"}]},"trackingParams":"CNEBEJsrIhMIg6eXk4qj7AIVRgLVCh2UFg8UMgV3YXRjaA==","unsubscribeButtonText":{"runs":[{"text":"Unsubscribe"}]},"longSubscriberCountText":{"runs":[{"text":"1.36K subscribers"}]},"shortSubscriberCountText":{"simpleText":"1.36K"},"subscribeAccessibility":{"accessibilityData":{"label":"Subscribe to TDD TV."}},"unsubscribeAccessibility":{"accessibilityData":{"label":"Unsubscribe from TDD TV."}},"notificationPreferenceButton":{"subscriptionNotificationToggleButtonRenderer":{"states":[{"stateId":2,"nextStateId":2,"state":{"buttonRenderer":{"style":"ST thSeconds":"4331","keywords":["uncle bob","solid principles","robert martin","single responsibility principle","dependency inversion principle","clean code","software craftsmanship","clean architecture","liskov substitution principle","interface segregation principle","solid design","software development","software architecture","javascript","software","programming","computer science","agile","developer","developers","solid","coding","S.O.L.I.D. Principles of OO Agile Design Uncle Bob Martin"],"channelId":"UCiRBjSlxIlt5URzgHSGhHQA","isOwnerViewing":false,"shortDescription":"READ FIRST:\n\nThis video is more valuable that just \"another SOLID talk\". \n\nThis talk is still very entertaining and informative so sit back, relax, and enjoy!  Sometimes it's good for us to learn and understand the past, so that we do not make the same mistakes that have been made over and over again in this profession.\n\nIf you want a more in-depth training on it, UB has that on his CleanCoders.com site.  Very good vids there...very in depth on coding techniques and he codes a lot there.\n\nhttps://www.CleanCoders.com - ton of vids by UB, very in depth technically\nhttp://www.WeDoTDD.com/interviews/companies/16\nhttps://twitter.com/unclebobmartin\nhttp://blog.cleancoder.com\nhttps://blog.8thlight.com/uncle-bob/archive.html\n\nSource:\nThis presentation was given by Uncle Bob on Feb 4, 2015 at the Arlington Lakes Golf Club in Arlington Heights, IL.\n\nSchaumburg Microsoft .NET Technologies Meetup http://bit.ly/1hAO2ln\nBe sure to change the video to 1080p when watching it\nRecorded with my IPhone 6+ 1080p (60fps)\n\nSide Note:\n\nUB talks little about SR and DI toward the end, but it's more a talk around business and more top level tech talk around around decoupling code and history of coding (where the idea of decoupling stemmed from, how objects came into existence and why, and how programming languages were affected by it ended up providing polymorphism... and a lot of other interesting things around the importance of plug-in software....all indirectly related to the topic of SOLID itself as a whole.\n\nThe S.O.L.I.D. Principles of OO and Agile Design\n\nWhat happens to software? Why does is rot over time? How does an Agile Development team prevent this rot, and prevent good designs from becoming legacy code? How can we be sure our designs are good in the first place? This talk presents the agile S.O.L.I.D. principles for designing object oriented class structures. These principles govern the structure and inter dependencies between classes in large object oriented systems. \n\nThe principles include: The Open Closed Principle, The Liskov Substitution Principle, and the Dependency Inversion Principle, among others.\n\nAbout \"Uncle Bob\" Martin:\n\nRobert C. Martin has been a software professional since 1970. In the last 35 years, he has worked in various capacities on literally hundreds of software projects. He has authored \"landmark\" books on Agile Programming, Extreme Programming, UML, Object-Oriented Programming, and C++ Programming. He has published dozens of articles in various trade journals. Today, He is one of the software industry's leading authorities on Agile software development and is a regular speaker at international conferences and trade shows. He is a former editor of the C++ Report and currently writes a monthly Craftsman column for Software Development magazine. software craftsmanship","isCrawlable":true,"thumbnail":{"thumbnails":[{"url":"https://i.ytimg.com/vi/t86v3N4OshQ/hqdefault.jpg?sqp=-oaymwEYCKgBEF5IVfKriqkDCwgBFQAAiEIYAXAB\u0026rs=AOn4CLAwSmyvh7nWKlhbG3qUZdN1LYnOiA","width":168,"height":94},{"url":"https://i.ytimg.com/vi/t86v3N4OshQ/hqdefault.jpg?sqp=-oaymwEYCMQBEG5IVfKriqkDCwgBFQAAiEIYAXAB\u0026rs=AOn4CLAly8khsH6DqiETNtLZmidZIc9XpA","width":196,"height":110},{"url":"https://i.ytimg.com/vi/t86v3N4OshQ/hqdefault.jpg?sqp=-oaymwEZCPYBEIoBSFXyq4qpAwsIARUAAIhCGAFwAQ==\u0026rs=AOn4CLDbxOU191JUElAreU7ny0UF80pZ9w","width":246 clebobmartin\nhttp://blog.cleancoder.com\nhttps://blog.8thlight.com/uncle-bob/archive.html\n\nSource:\nThis presentation was given by Uncle Bob on Feb 4, 2015 at the Arlington Lakes Golf Club in Arlington Heights, IL.\n\nSchaumburg Microsoft .NET Technologies Meetup http://bit.ly/1hAO2ln\nBe sure to change the video to 1080p when watching it\nRecorded with my IPhone 6+ 1080p (60fps)\n\nSide Note:\n\nUB talks little about SR and DI toward the end, but it's more a talk around business and more top level tech talk around around decoupling code and history of coding (where the idea of decoupling stemmed from, how objects came into existence and why, and how programming languages were affected by it ended up providing polymorphism... and a lot of other interesting things around the importance of plug-in software....all indirectly related to the topic of SOLID itself as a whole.\n\nThe S.O.L.I.D. Principles of OO and Agile Design\n\nWhat happens to software? Why does is rot over time? How does an Agile Development team prevent this rot, and prevent good designs from becoming legacy code? How can we be sure our designs are good in the first place? This talk presents the agile S.O.L.I.D. principles for designing object oriented class structures. These principles govern the structure and inter dependencies between classes in large object oriented systems. \n\nThe principles include: The Open Closed Principle, The Liskov Substitution Principle, and the Dependency Inversion Principle, among others.\n\nAbout \"Uncle Bob\" Martin:\n\nRobert C. Martin has been a software professional since 1970. In the last 35 years, he has worked in various capacities on literally hundreds of software projects. He has authored \"landmark\" books on Agile Programming, Extreme Programming, UML, Object-Oriented Programming, and C++ Programming. He has published dozens of articles in various trade journals. Today, He is one of the software industry's leading authorities on Agile software development and is a regular speaker at international conferences and trade shows. He is a former editor of the C++ Report and currently writes a monthly Craftsman column for Software Development magazine. software craftsmanship"},"lengthSeconds":"4332","ownerProfileUrl":"http://www.youtube.com/user/schinkelfamily","externalChannelId":"UCiRBjSlxIlt5URzgHSGhHQA","isFamilySafe":true,"availableCountries":["AD","AE","AF","AG","AI","AL","AM","AO","AQ","AR","AS","AT","AU","AW","AX","AZ","BA","BB","BD","BE","BF","BG","BH","BI","BJ","BL","BM","BN","BO","BQ","BR","BS","BT","BV","BW","BY","BZ","CA","CC","CD","CF","CG","CH","CI","CK","CL","CM","CN","CO","CR","CU","CV","CW","CX","CY","CZ","DE","DJ","DK","DM","DO","DZ","EC","EE","EG","EH","ER","ES","ET","FI","FJ","FK","FM","FO","FR","GA","GB","GD","GE","GF","GG","GH","GI","GL","GM","GN","GP","GQ","GR","GS","GT","GU","GW","GY","HK","HM","HN","HR","HT","HU","ID","IE","IL","IM","IN","IO","IQ","IR","IS","IT","JE","JM","JO","JP","KE","KG","KH","KI","KM","KN","KP","KR","KW","KY","KZ","LA","LB","LC","LI","LK","LR","LS","LT","LU","LV","LY","MA","MC","MD","ME","MF","MG","MH","MK","ML","MM","MN","MO","MP","MQ","MR","MS","MT","MU","MV","MW","MX","MY","MZ","NA","NC","NE","NF","NG","NI","NL","NO","NP","NR","NU","NZ","OM","PA","PE","PF","PG","PH","PK","PL","PM","PN","PR","PS","PT","PW","PY","QA","RE","RO","RS","RU","RW","SA","SB","SC","SD","SE","SG","SH","SI","SJ","SK","SL","SM","SN","SO","SR","SS","ST","SV","SX","SY","SZ","TC","TD","TF","TG","TH","TJ","TK","TL","TM","TN","TO","TR","TT","TV","TW","TZ","UA","UG","UM","US","UY","UZ","VA","VC","VE","VG","VI","VN","VU","WF","WS","YE","YT","ZA","ZM","ZW"],"isUnlisted":false,"hasYpcMetadata":false,"viewCount":"188503","category":"Science \u0026 Technology","publishDate":"2015-02-06","ownerChannelName":"TDD TV","uploadDate":"2015-02-06"}},"trackingParams":"CAAQu2kiEwjfrpeTiqPsAhVSCNUKHdInDC0=","attestation":{"playerAttestationRenderer":{"challenge":"a=5\u0026a2=1\u0026b=lKF_N7LlfVZlz31wN8-txP7Ooho\u0026c=16020
